import axios from "axios";


const buying_Datasend = (sell_price, quantity) =>{
    console.log(sell_price)
    console.log(quantity)
    const client = axios.create();   // axios 기능생성
    const price = sell_price
    const quantity_ = quantity   
    client.post('/api' , {price, quantity_} );   //axios 기능을 통한 post 사용및 name 값 전달.
}

export default buying_Datasend;
